    axios.get(`https://app-hrsei-api.herokuapp.com/api/fec2/hr-rfp/products/40`,{
        headers: {
            Authorization: "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",
          }
    })
      .then(res => {console.log(res)
        const persons = res.data;
        this.setState({ persons });
      })
  }

  render() {
    return (
      <ul  style={{color:"white"}}>
        { this.state.persons.map(person => <li>{person.name}</li>)}
      </ul>
    )
  }
}
